import React from "react";
import "./HorizontalneListe.css";
import Style from "radium";

function HorizontalnaLista(props)
{
    
    return(
        <div>
             <Style
                scopeSelector="ul"
                rules={{
                    color:"red"
                }}
            />
             <ul>
          
          <li>{props.prvi}</li>
          <li>{props.drugi}</li>
          <li>{props.treci}</li>
          <li>{props.cetvrti}</li>
      </ul>
        </div>
       
    );
}

export default HorizontalnaLista;
